import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App'
import {
    HashRouter as Router
  } from "react-router-dom";

  // ========================================

  ReactDOM.createRoot(
    <React.StrictMode>
      <Router>
      <App />
      </Router>
    </React.StrictMode>,
    document.getElementById('root')
  );
